```mongodb
db.patients.aggregate([
    {
        $match: {
            "CLAIMS.MEDICATIONS.DESCRIPTION": "Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet"
        }
    },
    {
        $unwind: "$CLAIMS"
    },
    {
        $unwind: "$CLAIMS.MEDICATIONS"
    },
    {
        $match: {
            "CLAIMS.MEDICATIONS.DESCRIPTION": "Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet"
        }
    },
    {
        $group: {
            _id: "$CLAIMS.PAYER"
        }
    },
    {
        $project: {
            _id: 0,
            payer: "$_id"
        }
    }
])
```

```mongodb
db.patients.aggregate([
    {
        $match: {"ENCOUNTERS.SUPPLIES.DESCRIPTION": "Blood glucose testing strips (physical object)"},
    },
    {
        $unwind: "$ENCOUNTERS",
    },
    {
        $unwind: "$ENCOUNTERS.SUPPLIES",
    },
    {
        $match: {"ENCOUNTERS.SUPPLIES.DESCRIPTION": "Blood glucose testing strips (physical object)"},
    },
    {
        $group: {
            _id: { first: "$FIRST", last: "$LAST" },
        },
    },
    {
        $project: { _id: 0, first: "$_id.first", last: "$_id.last" },
    },
])
